import React from "react";

function Home() {
  return (
    <div
      style={{
        height: "100vh",
        display: "flex",
        flexDirection: "column",
        justifyContent: "center",
        alignItems: "center",
        backgroundColor: "#2b87a3",
        color:"#252353ff",
        fontFamily: "Arial, sans-serif",
      }}
    >
      <h1 style={{fontSize: "2rem"}}>SPS REACT TEST</h1>
      <Link
        to="/login"
        style={{
          padding: "15px 30px",
          backgroundColor: "#a3672a",
          color: "white",
          fontWeight: "600",
          fontSize: "1.5rem",
          borderRadius: "8px",
          textDecoration: "none",
          boxShadow: "0 4px 6px #252353ff",
          transition: "background-color 0.3s ease",
        }}
        onMouseEnter={e => (e.target.style.backgroundColor = "#a3872aff")}
        onMouseLeave={e => (e.target.style.backgroundColor = "#a3672a")}
      > Login
      </Link>
      
      <Link
        to="/users"
        style={{
          padding: "15px 30px",
          backgroundColor: "#a3672a",
          color: "white",
          fontWeight: "600",
          fontSize: "1.5rem",
          borderRadius: "8px",
          textDecoration: "none",
          boxShadow: "0 4px 6px #252353ff",
          transition: "background-color 0.3s ease",
        }}
        onMouseEnter={e => (e.target.style.backgroundColor = "#a3872aff")}
        onMouseLeave={e => (e.target.style.backgroundColor = "#a3672a")}
      > Ver Usu√°rios </Link>

    </div>
  );
}

export default Home;
